import binascii
import os

def msdash_shorcut(filename, altxboxdash):
	# Add shortcut to MSDash/UIX Lite to applications folder
	uix_override = 'E:/Applications/MSDash/Override_TitleID.bin'
	shortcut_out = 'E:/Applications/MSDash'
	
	if not os.path.isdir(shortcut_out):
		os.makedirs(shortcut_out)
	if os.path.isfile(uix_override):
		os.remove(uix_override)

	xbename = '4D006900630072006F0073006F00660074002000440061007300680062006F006100720064'
	if "uix lite.zip" == filename: 
		xbename = '55004900580020004C00690074006500000000000000000000000000000000000000000000'
		with open(uix_override,'w') as override:
			override.write("UIXULITE")

	Oor0 = '6F'
	if altxboxdash:
		Oor0 = '30'

	attach_bytes = binascii.unhexlify('{}{}'.format(xbename, Oor0))
	with open(os.path.join(shortcut_out, 'default.xbe'), 'wb') as attach_xbe:
		attach_xbe.write(attach_bytes)